import React from "react";
import styled from "styled-components";

class AboutPage extends React.Component{
    render(){
        return(
            <Wrapper>
                <Title>About me</Title>
                <AboutContainer>
                    <MainContainer>
                        <InformationBox>
                            <Header>Hello! I'm Vickel</Header>
                            <Information>Here is just some information about me</Information>
                        </InformationBox>
                        <DownloadButton >Download Resume</DownloadButton>

                    </MainContainer>
                    <SecondContainer>
                        <FactBox>
                            <Header>Fun facts about me</Header>
                            <BulletPoints>1- I love food</BulletPoints>
                        </FactBox>
                    </SecondContainer>
                </AboutContainer>
            </Wrapper>
        )
    }
}

export {AboutPage};

const Title = styled.h1`text-align:center;`;

const Wrapper = styled.div``

const MainContainer = styled.div`
    border-right:2px solid black;
    height:50%;
    display:relative;
    width:60%;
`;

const SecondContainer = styled.div`
width:40%;

`;

const DownloadButton = styled.a`
padding: 1.5%;
text-decoration:none;
color:black;
background-color: #C4C4C4;
`;

const InformationBox = styled.div``;

const Header = styled.h1``;

const Information = styled.p``;

const BulletPoints = styled.p``;

const FactBox = styled.div`
border:2px solid black;
`;

const AboutContainer = styled.div`
display:flex; 
flex-direction:row;
width:100%;
`;
